uInt32 FilesystemNodeSTM32::read(ByteBuffer& image) const
{
  #define ROM_SIZE (8 * 1024)

  image = make_unique<uInt8[]>(ROM_SIZE);
  memcpy(image.get(), _rom, ROM_SIZE);

  return (ROM_SIZE);
}
